import React, { useState } from 'react';
import { useOutletContext } from 'react-router-dom';
import API from '../api';
import { jwtDecode } from 'jwt-decode';

export default function DashboardPage() {
  const { overview: layoutOverview, dataSource: layoutDataSource } = useOutletContext();
  const [dataSource, setDataSource] = useState(layoutDataSource || 'sample');
  const [ingesting, setIngesting] = useState(false);
  const [error, setError] = useState('');

  const overview = layoutOverview || { totalCustomers: 0, totalOrders: 0, revenue: 0 };

  const handleIngestData = async (type) => {
    try {
      setIngesting(true);
      setError('');
      const token = localStorage.getItem('token');
      const { tenantId } = jwtDecode(token);

      if (type === 'sample') {
        // Sample Customers
        await API.post(`/ingest/tenant/${tenantId}/customers`, [
          { id: 201, first_name: "Priya", last_name: "Sharma", email: "priya.s@example.com" },
          { id: 202, first_name: "Rohan", last_name: "Kumar", email: "rohan.k@example.com" },
          { id: 203, first_name: "Anjali", last_name: "Gupta", email: "anjali.g@example.com" },
          { id: 204, first_name: "Vikram", last_name: "Singh", email: "vikram.s@example.com" },
          { id: 205, first_name: "Sneha", last_name: "Patel", email: "sneha.p@example.com" },
          { id: 206, first_name: "Amit", last_name: "Verma", email: "amit.v@example.com" },
          { id: 207, first_name: "Deepika", last_name: "Reddy", email: "deepika.r@example.com" },
          { id: 208, first_name: "Sanjay", last_name: "Joshi", email: "sanjay.j@example.com" },
          { id: 209, first_name: "Neha", last_name: "Mehta", email: "neha.m@example.com" },
          { id: 210, first_name: "Rajesh", last_name: "Nair", email: "rajesh.n@example.com" },
          { id: 211, first_name: "Kiran", last_name: "Iyer", email: "kiran.i@example.com" },
          { id: 212, first_name: "Alok", last_name: "Chaudhary", email: "alok.c@example.com" },
          { id: 213, first_name: "Tanisha", last_name: "Ranjan", email: "tanisha.r@example.com" },
          { id: 214, first_name: "Ritika", last_name: "Sen", email: "ritika.s@example.com" },
          { id: 215, first_name: "Manish", last_name: "Gupta", email: "manish.g@example.com" },
        ]);

        // Sample Products
        await API.post(`/ingest/tenant/${tenantId}/products`, [
          { id: 101, title: "Classic T-Shirt", price: "25.00" },
          { id: 102, title: "Denim Jeans", price: "75.00" },
          { id: 103, title: "Leather Belt", price: "35.00" },
          { id: 104, title: "Sunglasses", price: "55.00" },
          { id: 105, title: "Cozy Hoodie", price: "60.00" },
          { id: 106, title: "Knit Beanie", price: "20.00" },
        ]);

        // Sample Orders
        await API.post(`/ingest/tenant/${tenantId}/orders`, [
          { id: 1001, total_price: "100.00", created_at: "2025-09-10T10:00:00Z", customer: { id: 201 }, line_items: [{ product_id: 101, quantity: 1, price: "25.00" }, { product_id: 102, quantity: 1, price: "75.00" }] },
          { id: 1002, total_price: "50.00", created_at: "2025-09-09T15:30:00Z", customer: { id: 202 }, line_items: [{ product_id: 101, quantity: 2, price: "25.00" }] },
          { id: 1003, total_price: "90.00", created_at: "2025-09-08T11:00:00Z", customer: { id: 203 }, line_items: [{ product_id: 103, quantity: 1, price: "35.00" }, { product_id: 104, quantity: 1, price: "55.00" }] },
          { id: 1004, total_price: "150.00", created_at: "2025-09-07T18:45:00Z", customer: { id: 202 }, line_items: [{ product_id: 102, quantity: 2, price: "75.00" }] },
          { id: 1005, total_price: "80.00", created_at: "2025-09-06T12:00:00Z", customer: { id: 204 }, line_items: [{ product_id: 105, quantity: 1, price: "60.00" }, { product_id: 106, quantity: 1, price: "20.00" }] },
          { id: 1006, total_price: "25.00", created_at: "2025-09-05T09:20:00Z", customer: { id: 205 }, line_items: [{ product_id: 101, quantity: 1, price: "25.00" }] },
          { id: 1007, total_price: "135.00", created_at: "2025-09-04T14:55:00Z", customer: { id: 206 }, line_items: [{ product_id: 102, quantity: 1, price: "75.00" }, { product_id: 105, quantity: 1, price: "60.00" }] },
          { id: 1008, total_price: "75.00", created_at: "2025-09-03T20:10:00Z", customer: { id: 207 }, line_items: [{ product_id: 102, quantity: 1, price: "75.00" }] },
          { id: 1009, total_price: "115.00", created_at: "2025-09-02T13:00:00Z", customer: { id: 201 }, line_items: [{ product_id: 104, quantity: 1, price: "55.00" }, { product_id: 105, quantity: 1, price: "60.00" }] },
          { id: 1010, total_price: "40.00", created_at: "2025-09-01T16:00:00Z", customer: { id: 208 }, line_items: [{ product_id: 106, quantity: 2, price: "20.00" }] },
          // ... include all other orders as before ...
        ]);
      } else if (type === 'shopify') {
        // Call Shopify ingestion endpoint
        await API.post(`/ingest/tenant/${tenantId}/shopify`);
      }

      setDataSource(type);
      setError('');
      window.location.reload();
    } catch (err) {
      setError('Failed to ingest data. Please check server logs.');
      console.error(err);
    } finally {
      setIngesting(false);
    }
  };

  return (
    <div style={pageStyle}>
      {/* Empty dashboard message */}
      {overview && overview.totalCustomers === 0 && (
        <div style={emptyStyle}>
          <h4>Your dashboard is empty!</h4>
          <p>Data will appear here once available.</p>
        </div>
      )}

      {error && <div style={{ color: 'red', margin: '10px 0', textAlign: 'center' }}>{error}</div>}

      {/* Overview cards */}
      {overview && overview.totalCustomers > 0 && (
        <>
          <h1 style={titleStyle}>Overview</h1>
          <div style={cardsContainerStyle}>
            <InteractiveCard title="Total Customers" value={overview.totalCustomers} />
            <InteractiveCard title="Total Orders" value={overview.totalOrders} />
            <InteractiveCard title="Revenue" value={`₹${parseFloat(overview.revenue ?? 0)}`} />
          </div>
        </>
      )}
    </div>
  );
}

// Card component
function InteractiveCard({ title, value }) {
  return (
    <div style={interactiveCardStyle}>
      <h2 style={labelStyle}>{title}</h2>
      <p style={valueStyle}>{value}</p>
    </div>
  );
}

// --- Styles ---
const pageStyle = {
  padding: '40px',
  minHeight: '100vh',
  background: 'linear-gradient(135deg, #f5f7fa 0%, #c3cfe2 100%)',
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
};

const titleStyle = {
  fontSize: '48px',
  marginBottom: '50px',
  color: '#222',
  textShadow: '2px 2px 8px rgba(0,0,0,0.1)',
};

const cardsContainerStyle = {
  display: 'flex',
  justifyContent: 'center',
  gap: '40px',
  flexWrap: 'wrap',
};

const interactiveCardStyle = {
  borderRadius: '16px',
  padding: '30px 40px',
  width: '260px',
  textAlign: 'center',
  backgroundColor: '#fff',
  boxShadow: '6px 6px 20px rgba(0,0,0,0.1)',
  transition: 'all 0.3s ease',
  cursor: 'pointer',
};

const labelStyle = { fontSize: '24px', marginBottom: '15px', fontWeight: '600', color: '#444' };
const valueStyle = { fontSize: '36px', fontWeight: '700', color: '#007bff', margin: 0 };

const emptyStyle = {
  padding: '20px',
  margin: '20px 0',
  backgroundColor: '#eef',
  border: '1px solid #ccf',
  borderRadius: '12px',
  textAlign: 'center',
};
